import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useState } from 'react';

function App() {
  const [data, setData] = useState([
    {
      "id": 1,
      "name": "rushi",
      "lastName": "kantaria",
      "email": "email",
      "email": "email",
      "email": "email",
