    }
  ])
  return (
    <div className="App">
      <table class="table table-striped">
        <thead>
          <tr>
            <th>Firstname</th>
            <th>Lastname</th>
            <th>Email</th>
            <th>Email</th>
            <th>Email</th>
            <th>button</th>
          </tr>
        </thead>
        {data.map((item) => {
          return(
            <tbody>
                <tr>
                  <td>{item.name}</td>
                  <td>{item.lastName}</td>
                  <td>{item.email}</td>
                  <td>{item.email}</td>
                  <td>{item.email}</td>
                  <td> <button onClick={(item) => console.log("item ---->", item.id)}>{item.save}</button> </td>
                </tr>
            </tbody>
          )
        })}
      </table>
    </div>
  );
}

export default App;
